(()=>{class t{static TITLE_REG=/(#+)\s+([^\n]+)/;constructor(t){this.text=t}parse(){return this.text.replace(/.+/g,(e=>(console.log(e),t.isTitle(e)?this.parseTitle(e):this.parseParagraph(e))))}parseParagraph(t){return t.trim().length?`<p>${t.trim()}</p>`:""}parseTitle(e){return e.replace(t.TITLE_REG,(function(t){let e=RegExp.$1.length>6?6:RegExp.$1.length;return`<h${e}>${RegExp.$2}</h${e}>`}))}static isTitle(e){return t.TITLE_REG.test(e)}}var e=document.querySelector("article");e.textContent;let r=new t(e.textContent).parse();e.innerHTML=r})();